    "I am ready to start this timed exam,": "Estic preparat per iniciar aquest examen cronometrat,",
    "ID": "Identificador",
    "ID-Verification is not required for this Professional Education course.": "La verificaci\u00f3 d'identificaci\u00f3 no \u00e9s necess\u00e0ria per a aquest curs d'Educaci\u00f3 Professional.",
    "Identity Verification In Progress": "Verificaci\u00f3 d'identitat en curs",
    "If the course does not have an end date, learners always see their scores when they submit answers to assessments.": "Si el curs no t\u00e9 data de finalitzaci\u00f3, els estudiants sempre veuen les puntuacions quan envien respostes a les avaluacions.",
    "If the photos you submit are rejected, try moving the computer or camera orientation to change the lighting angle.  The most common reason for rejection is inability to read the text on the ID card.": "Si les photos que vous soumettez sont rejet\u00e9es, essayez de d\u00e9placer l'ordinateur ou l'appareil photo pour changer l'angle d'\u00e9clairage. Le motif de rejet le plus fr\u00e9quent est l'incapacit\u00e9 de lire le texte de la carte d'identit\u00e9.",
    "If the subsection does not have a due date, learners always see their scores when they submit answers to assessments.": "Si la subsecci\u00f3 no t\u00e9 data de venciment, els estudiants sempre veuen les puntuacions quan envien respostes a les avaluacions.",
    "If the unit was previously published and released to learners, any changes you made to the unit when it was hidden will now be visible to learners.": "Si la unitat es va publicar i es va publicar pr\u00e8viament als estudiants, els canvis que h\u00e0giu fet a la unitat quan estigu\u00e9s oculta ara seran visibles per als estudiants.",
    "If the unit was previously published and released to students, any changes you made to the unit when it was hidden will now be visible to students. Do you want to proceed?": "Si l'unit\u00e9 a d\u00e9j\u00e0 \u00e9t\u00e9 publi\u00e9e et diffus\u00e9e aux \u00e9tudiants, tous les changements apport\u00e9s \u00e0 l'unit\u00e9 pendant qu' elle \u00e9tait cach\u00e9e seront d\u00e9sormais visibles par les \u00e9tudiants. Voulez-vous continuer?",
    "If you do not yet have an account, use the button below to register.": "Si encara no teniu un compte, utilitzeu el bot\u00f3 seg\u00fcent per registrar-se.",
    "If you don't verify your identity now, you can still explore your course from your dashboard. You will receive periodic reminders from %(platformName)s to verify your identity.": "Si encara no comprova la vostra identitat, encara podeu explorar el vostre curs des del tauler. Rebr\u00e0 recordatoris peri\u00f2dics de %(platformName)s per verificar la vostra identitat.",
    "If you don't verify your identity now, you can still explore your course from your dashboard. You will receive periodic reminders from {platformName} to verify your identity.": "Si encara no comprova la vostra identitat, encara podeu explorar el vostre curs des del tauler. Rebreu els recordatoris peri\u00f2dics de {platformName} per verificar la vostra identitat.",
    "If you leave this page without saving or submitting your response, you will lose any work you have done on the response.": "Si vous quittez cette page sans la sauvegarder ou soumettre votre r\u00e9ponse, vous perdrez tout le travail r\u00e9alis\u00e9 pour cette r\u00e9ponse.",
    "If you leave this page without submitting your peer assessment, you will lose any work you have done.": "Si vous quittez cette page sans envoyer votre \u00e9valuation par les pairs, vous perdrez tout le travail r\u00e9alis\u00e9.",
    "If you leave this page without submitting your self assessment, you will lose any work you have done.": "Si vous quittez cette page sans envoyer votre auto-\u00e9valuation, vous perdrez tout le travail r\u00e9alis\u00e9.",
    "If you leave this page without submitting your staff assessment, you will lose any work you have done.": "Si vous quittez cette page sans envoyer votre \u00e9valuation par l'\u00e9quipe p\u00e9dagogique, vous perdrez tout le travail r\u00e9alis\u00e9.",
    "If you make significant changes, make sure you notify members of the team before making these changes.": "Si vous r\u00e9alisez d'importants changements, pr\u00e9venez les membres de l'\u00e9quipe avant de les faire.",
    "If you make this %(xblockType)s visible to learners, learners will be able to see its content after the release date has passed and you have published the unit. Only units that are explicitly hidden from learners will remain hidden after you clear this option for the %(xblockType)s.": "Si fa que aquest %(xblockType)s sigui visible per als estudiants, els aprenents podran veure el seu contingut despr\u00e9s de la data de llan\u00e7ament i han publicat la unitat. Nom\u00e9s les unitats que estan expl\u00edcitament amagades pels aprenents romandran ocultes despr\u00e9s d'esborrar aquesta opci\u00f3 per a %(xblockType)s.",
    "If you remove this transcript, the transcript will not be available for any components that use this video.": "Si elimineu aquesta transcripci\u00f3, la transcripci\u00f3 no estar\u00e0 disponible per als components que utilitzin aquest v\u00eddeo.",
    "If you remove this transcript, the transcript will not be available for this component.": "Si vous supprimez cette transcription, la transcription ne sera pas disponible pour ce composant.",
    "If you require assistance with taking either photo for submission, contact %(platformName)s support for additional suggestions.": "Si vous avez besoin d'aide pour prendre l'une ou l'autre des photos \u00e0 soumettre, contactez le support de %(platformName)s pour des suggestions suppl\u00e9mentaires.",
    "If you select an option other than \"%(hide_label)s\", published units in this subsection become available to learners unless they are explicitly hidden.": "Si seleccioneu una opci\u00f3 diferent \"%(hide_label)s\", les unitats publicades en aquesta subsecci\u00f3 estaran disponibles per als estudiants, tret que estiguin expl\u00edcitament amagades.",
    "If you still wish to continue and delete your account, please enter your account password:": "Si vous souhaitez toujours supprimer votre compte, veuillez saisir le mot de passe de votre compte :",
    "If you use the Advanced Editor, this problem will be converted to XML and you will not be able to return to the Simple Editor Interface.\n\nProceed to the Advanced Editor and convert this problem to XML?": "Si vous utilisez l'\u00e9diteur avanc\u00e9, ce probl\u00e8me sera converti en XML et vous ne serez plus en mesure de revenir \u00e0 l'interface d'\u00e9dition simple.\nPasser \u00e0 l'\u00e9diteur avanc\u00e9 et convertir ce probl\u00e8me en XML?",
